const EmployeeForm = () => {
    empEntry = {
        empName : String,
        emailId : String,
        dob : Date,
        joinDate : Date
    };
    const { empEntry, handleSubmit, formState: {errors} } = useForm();
    const handleEntry = (data) => console.log(data);
    const handleError = (errors) => {};

    const errorMsg = {
        empName : { required : "Employee Name is required"},
        emailId : { required : "Email Id is required"},
        dob : { required : "Date of Birth is mandatory"},
        joinDate : { required : "Joining Date is mandatory"}
    };

    return(
       <form onSubmit={handleSubmit(handleEntry, handleError)}>
        <div>
        <label>Employee Name</label>
        <input name="empName" type="text" {...empEntry.empName}/>
        <small> { errors?.empName && errors.empName.message } </small>
        </div>
        <div>S
                <label>Employee EmailId</label>
        <input name="emailId" type="text" {...empEntry.emailId}/>
        <small>{ errors?.emailId && errors.emailId.message }</small>
        </div>
        <div>
                <label>Employee Date Of Birth</label>
                  <input name="dob" type="date" {...empEntry.dob}/>
                  <small>{ errors?.dob && errors.dob.message }</small>
        </div>
        <div>
            <label>Employee Joining Date</label>
            <input name="joinDate" type="date" {...empEntry.joiningDate}/>
            <small>{ errors?.joinDate && errors.joinDate.message }</small>
        </div>
        <button type="submit">Submit</button>
       </form>

    );
}

